
import { readFileSync } from 'fs';
import { sanitizeHtml } from './sanitizer';
import { ParsedRequest } from './types';
const twemoji = require('twemoji');
const twOptions = { folder: 'svg', ext: '.svg' };
const emojify = (text: string) => twemoji.parse(text, twOptions);

const rglr = readFileSync(`${__dirname}/../_fonts/Inter-Regular.woff2`).toString('base64');
const bold = readFileSync(`${__dirname}/../_fonts/Inter-Bold.woff2`).toString('base64');
const mono = readFileSync(`${__dirname}/../_fonts/Vera-Mono.woff2`).toString('base64');

function getCss(image: string) {
    let background = 'rgba(0,0,0,.74)';
    let foreground = '#d32e79';

    return `
    @font-face {
        font-family: 'Inter';
        font-style:  normal;
        font-weight: normal;
        src: url(data:font/woff2;charset=utf-8;base64,${rglr}) format('woff2');
    }

    @font-face {
        font-family: 'Inter';
        font-style:  normal;
        font-weight: bold;
        src: url(data:font/woff2;charset=utf-8;base64,${bold}) format('woff2');
    }

    @font-face {
        font-family: 'Vera';
        font-style: normal;
        font-weight: normal;
        src: url(data:font/woff2;charset=utf-8;base64,${mono})  format("woff2");
      }

    body {
        background: ${background};
        background-image: url(${image});
        background-size: cover;
        background-position: center;
        background-repeat: no-repeat;

        height: 100vh;
        display: flex;
        text-align: center;
        align-items: center;
        justify-content: center;
    }

    .kodadot-logo {
        position: fixed;
        top: 40px;
        right: 60px;
        width: 128px;
        height: 128px;
        object-fit: contain;
        z-index: 2;
    }

    .price {
        background: ${foreground};
        color: white;
        font-family: 'Inter', sans-serif;
        font-size: 50px;
        font-style: normal;
        padding: 15px 20px;
        border-radius: 10px;
        position: fixed;
        left: 60px;
        bottom: 215px;
    }
    
    .heading {
        font-family: 'Inter', sans-serif;
        font-size: 80px;
        font-style: normal;
        color: white;
        line-height: 1.8;
        background: rgba(0,0,0,.6);
        text-align: center;
        padding: 15px;
        position: fixed;
        bottom: 0;
        left: 0;
        z-index: 1;
        width: 100%;
    }`;
}

export function getHtml(parsedReq: ParsedRequest) {
    const { text, image, price } = parsedReq;

    let priceHtml = price && price !== 'undefined' ? '<div class="price">'+price+'</div>' : '';

    return `<!DOCTYPE html>
<html>
    <meta charset="utf-8">
    <title>Generated Image</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <style>
        ${getCss(image || 'https://nft.kodadot.xyz/kodadot_carbonless.jpg')}
    </style>
    <body>
        <div>
            <div class="imageWrapper">    
               ${ priceHtml }
               <div class="heading">${emojify(sanitizeHtml(text))}</div>
               <img class="kodadot-logo" src="data:image/png;base64," />
            </div>
        </div>
    </body>
</html>`;
}

